filters:
 - '>'
comment: |-
  select t2.name,
         t2.capacity
  from concert as t1
  join stadium as t2 on t1.stadium_id = t2.stadium_id
  where t1.year > 2013
  group by t2.stadium_id
  order by count(*) desc
  limit 1

sql: |-
  select t2.name,
         t2.capacity
  from concert as t1
  join stadium as t2 on t1.stadium_id = t2.stadium_id
  where t1.year > 2013
  group by t2.stadium_id
  order by count(*) desc
  limit 1
